import React from "react";
import styled from "styled-components";
import { getDeviceIcon, getPaymentType, getDotColor } from "./helper";
import { Text } from "../../../common/styles";

export const Container = styled.div`
  background-color: white;
  padding: 32px 0 88px 0;
`;

const Tr = styled.tr`
  height: 54px;
  padding: 16px 0 0;
  background-color: #ffffff;
  border: 1px solid #e9e9e9;

  > td span {
    margin-left: 30px;
    font-family: PingFangSC;
    font-size: 14px;
    line-height: 1.57;
    color: rgba(0, 0, 0, 0.65);
  }
`;

const TableHeaders = styled.tr`
  height: 54px;
  padding: 16px 60px 16px 32px;
  background-color: #fafafa;
`;

const TableHeader = styled.th`
  font-family: PingFangSC;
  font-size: 14px;
  font-weight: 500;
  line-height: 1.57;
  color: rgba(0, 0, 0, 0.65);
  text-align: left;

  > span {
    margin: 0 32px 0 32px;
  }
`;
const Table = styled.table`
  margin-left: 32px;
  border-collapse: collapse;
`;

const tableTitles = [
  "Date/Time",
  "Name",
  "Device",
  "Payment",
  "BIN Number",
  "Amount",
  "Trans ID",
  "Decision",
];

const tableContent = [
  {
    date: "2019-06-22 16:32:03",
    name: "Mandy Unsworth",
    device: "D",
    payment: "visa",
    binNumber: "234567",
    amount: "30$",
    transId: "5d909a2417…",
    decision: "Approved",
  },
  {
    date: "2019-06-22 21:03:17",
    name: "Graham Griffiths",
    device: "M",
    payment: "amex",
    binNumber: "638913",
    amount: "35$",
    transId: "763a677958...",
    decision: "Declined",
  },
  {
    date: "2019-06-22 16:32:03",
    name: "Mandy Unsworth",
    device: "D",
    payment: "mastercard",
    binNumber: "234567",
    amount: "30$",
    transId: "5d909a2417…",
    decision: "Reviewd",
  },
  {
    date: "2019-06-22 21:03:17",
    name: "Graham Griffiths",
    device: "M",
    payment: "amex",
    binNumber: "638913",
    amount: "35$",
    transId: "763a677958...",
    decision: "Processing",
  },
  {
    date: "2019-06-22 16:32:03",
    name: "Mandy Unsworth",
    device: "D",
    payment: "mastercard",
    binNumber: "234567",
    amount: "30$",
    transId: "5d909a2417…",
    decision: "Approved",
  },
];
const renderTableHeaders = () => {
  const header = Object.keys(tableTitles);
  return header.map((key, index) => {
    return (
      <TableHeader key={index}>
        <span>{tableTitles[key]}</span>
      </TableHeader>
    );
  });
};

const renderTableData = () => {
  return tableContent.map((transaction, index) => {
    const {
      date,
      name,
      device,
      payment,
      binNumber,
      amount,
      transId,
      decision,
    } = transaction;
    return (
      <Tr key={index}>
        <td>
          <span>{date}</span>
        </td>
        <td>
          <span>{name}</span>
        </td>
        <td>
          <span>{<img src={getDeviceIcon(device)} />}</span>
        </td>
        <td>
          <span>
            {
              <img
                style={{ width: "32px", height: "21px" }}
                src={getPaymentType(payment)}
              />
            }
          </span>
        </td>
        <td>
          <span>{binNumber}</span>
        </td>
        <td>
          <span>{amount}</span>
        </td>
        <td>
          <span>{transId}</span>
        </td>
        <td>
          <span>
            <div>
              <Text color={getDotColor(decision)}>{decision}</Text>
            </div>
          </span>
        </td>
      </Tr>
    );
  });
};
const TransactionLog = () => {
  return (
    <Container>
      <Table>
        <tbody>
          <TableHeaders>{renderTableHeaders()}</TableHeaders>
          {renderTableData()}
        </tbody>
      </Table>
    </Container>
  );
};

export default TransactionLog;
